import React, {Component} from 'react';
import {BrowserRouter as Router} from 'react-router-dom';
import Home from './component'

class App extends Component {
  render(){
    return(
      <Router>
        <Switch>
          <Route exact path="/" component={Home}/>
        </Switch>
      </Router>

    );
  }
}

export default App;
